                <div className="continue-shopping">
                    <img src="./images/arrow.png"  alt="arrow" className="arrow-icon"/>
                    <h3>Continue Shopping</h3>
                </div>
                <div className="cart-icon">
                <img src="./images/cart.png"  alt="cart" />
                </div>
                <p>1</p>
            </header>
            <section className="main-cart-section">

            </section>
        </>
    )
}

export default Cart;
